import React from 'react';
import Fade from "react-reveal/Fade";


export default function CategorySearch(props) {
  const goToHome=()=>{
    props.history.push(`/homecategory`)
  }
    const goToFashion=()=>{
        props.history.push(`/fashioncategory`)
      }
    const goToVision=()=>{
        props.history.push(`/visioncategory`)
      }
    const goToSouls=()=>{
        props.history.push(`/soulscategory`)
      }

    return (
        <Fade bottom cascade={true}>
      <div className="authContainer">
        <div className="form1">
            <div className='categoryContainer'>
            <div style={{margin:"20%"}}> <button onClick={goToHome}>Home</button></div>
            <div style={{margin:"20%"}}> <button onClick={goToFashion}>Fashion</button></div>
            <div style={{margin:"20%"}}><button onClick={goToVision}>Visions</button></div>
            <div style={{margin:"20%"}}><button onClick={goToSouls}>Souls In A Box</button></div>
            </div>


        </div>
      </div>
    </Fade>
    )
}
